"use strict";(self.webpackChunk_hades_ts_docs=self.webpackChunk_hades_ts_docs||[]).push([[1477],{10:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"new-docs-site","metadata":{"permalink":"/blog/new-docs-site","editUrl":"https://github.com/hades-ts/hades/tree/main/apps/docs/blog/blog/2022-06-25-docs-site/index.mdx","source":"@site/blog/2022-06-25-docs-site/index.mdx","title":"New Docs Site","description":"Hey all.","date":"2022-06-25T00:00:00.000Z","formattedDate":"June 25, 2022","tags":[{"label":"news","permalink":"/blog/tags/news"}],"readingTime":0.635,"hasTruncateMarker":false,"authors":[{"name":"Dustin Lacewell","title":"Maintainer","url":"https://github.com/dustinlacewell","imageURL":"https://avatars.githubusercontent.com/u/53952?v=4","key":"dustin"}],"frontMatter":{"slug":"new-docs-site","title":"New Docs Site","authors":["dustin"],"tags":["news"]}},"content":"import Admonition from \'@theme/Admonition\';\\n\\n\\nHey all. \\n\\nThere\'s a new docs site... and you\'re looking at it!\\n\\nAnd now I\'m gonna nerd out about it. :)\\n\\n\\n## Docusaurus\\nThe new site is built ontop of [Docusaurus V2](https://docusaurus.io).\\n\\nDocusaurus is a pretty great static site generator from Facebook. It\'s basically NextJS with the SSR ripped out.\\n\\nHere are some highlights:\\n\\n- Normal React TSX development for pages\\n- MDX support for content (Markdown + React)\\n- Has a nice blog\\n- Offline search\\n- Powerful automatic sidebar support\\n- Easy to add docs for new tools, libs and plugins\\n\\nIf you\'re just trying to contribute documentation or an article it doesn\'t get easier:\\n- edit markdown files under the [docs/](https://github.com/hades-ts/hades/tree/main/apps/docs/docs) or [blog/](https://github.com/hades-ts/hades/tree/main/apps/docs/apps)\\n- submit a pull request\\n\\nThat\'s it!"}]}')}}]);